import React from "react";
import { NextPage } from "next";
import { NextSeo } from "next-seo";

type Props = {};

const Boke: NextPage<Props, any> = ({ }) => {
  return (
    <div>
      <NextSeo title="音播" />
      <div style={{ textAlign: 'center', fontSize: '27px', maxWidth: '1200px' }}>
        <p>播客客户端页面模拟</p>
      </div>
      <section style={{ padding: '40px', marginTop: '20px', maxWidth: '1200px' }}>
        <div style={{width: '50%' }}>
          <form action="">
            <label htmlFor="">从 RSS Feed 读取播客节目信息 </label>
            <input placeholder="请输入 RSS Feed URL" type="text" name="url"/>
            <input type="submit" value="提交"/>
          </form>
        </div>
        <div></div>
      </section>
    </div>
  );
};

Boke.getInitialProps = async () => {
  return {
    namespacesRequired: ["common"],
  };
};

export default Boke;
